content: "1\nRy Tompo \xF4, tariho\nNy ondrikelinao\nTantano sy vimbino\nHanao ny\
  \ sitrakao.\nRaha misy hafaliana,\nDia taomy mba ho tia\nRaha sendra fahoriana,\n\
  Sakano tsy hania.\n\nRy Jeso \xF4! tazano\nNy lalanay izao,\nTariho sy tantano\n\
  Ho ao am-balanao;\nAnio dia mikasa\nHanolo-tena koa\nFa nenina ny lasa\nHiezaka\
  \ tokoa.\n2\nAnio ho hafaliako,\nNy foko lasanao\nNy maminao no tiako,\nHatao ny\
  \ sitrakao\nNy androko rehetra,\nAtolotro Anao;\nAnao tsy misy fetra,\nKa raiso,\
  \ anjakao."
id: 692
key: E
title: "RY TOMPO \xD4, TARIHO"
